import axios from 'axios';

const url = "https://specifications.vinaudit.com/v3/selections?key=9NSOAST0U19Z4HH&list=";

export function getVehicleYears() {
    return dispatch => {
        axios.get(url + "year&format=json").then(res => {
            dispatch({
                type: 'GET_VEHICLE_YEARS',
                years: res.data.selections
            })
        }).catch(err => {
            console.log(err)
        })
    }
}

export default function reducer(years = [], action) {
    switch(action.type) {
        case "GET_VEHICLE_YEARS":
            return action.years
        default: 
            return years
    }
}
